// src/components/HealthTrends.tsx
import React from 'react';
import { Bar } from 'react-chartjs-2';

interface HealthTrendsProps {
    data: number[];
    labels: string[];
}

const HealthTrends: React.FC<HealthTrendsProps> = ({ data, labels }) => {
    const chartData = {
        labels: labels,
        datasets: [
            {
                label: 'Health Trends',
                data: data,
                backgroundColor: 'rgba(75, 192, 192, 0.6)',
            },
        ],
    };

    return <Bar data={chartData} />;
};

export default HealthTrends;
